import React from 'react';
import './static/login.css';
import { Link } from 'react-router-dom';

function Login(){
	return (

			<div className="wrapper fadeInDown">
			  <div id="formContent">
			    {/* <!-- Tabs Titles */}

			    <h2 className="active trans"> Sign In </h2>
			    <Link to="/signup"><h2 className="inactive underlineHover trans">Sign Up </h2></Link>


			    {/* Login Form */}

			    <form>
			      <input type="text" id="login" className="fadeIn second trans" name="email" placeholder="Email" required/>
			      <input type="password" id="password" className="fadeIn third trans" name="passowrd" placeholder="Password" required/>
			      <input type="submit" className="fadeIn fourth trans" value="Log In" />
			    </form>

			    {/* Remind Passowrd */}

			    <div id="formFooter">
			      <a className="underlineHover trans" href="#">Forgot Password?</a>
			    </div>

			  </div>
			</div>

		);
}

export default Login
